// FillPreMedicalForm.js
import React, { useState } from 'react';
import { useAuth } from '../AuthContext';
import { fillPreMedicalForm } from '../apiService'; // Add this import

const FillPreMedicalForm = () => {
  const { user } = useAuth();
  const [symptoms, setSymptoms] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await fillPreMedicalForm({ symptoms, patient: user.id });
      // You may want to add a success message or redirect to a confirmation page
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <h2>Fill Pre-Medical Form</h2>
      <form onSubmit={handleSubmit}>
        <label>Symptoms:</label>
        <textarea value={symptoms} onChange={(e) => setSymptoms(e.target.value)} />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default FillPreMedicalForm;
